T:{Count:1b,ForgeCaps:{"dungeons_libraries:built_in_enchantments":{}},id:"minecraft:written_book",tag:{author:"Edward_the_llama",pages:['{"text":"I am the withering flower you see in the field\\n\\nSurrounded by all the beautiful ones\\n\\nMy roots bleed, and noone can see\\n\\nSince they are far beneath me"}','{"text":"Can noone try and see how unwatered I am?\\n\\nThe browned petals\\nThe crooked stem\\nThe falling leaves\\nMy heart among them\\n\\nEach one finally hits the ground.\\n\\n"}','{"text":"And my life force fades away\\n\\nSucking me dry"}'],title:"Withering Away"}}
